import styled from "styled-components";

// interface CategorieProps {
//   categoryPk: number;
//   categoryName: string;
//   categoryCode: string;
// }
export default function CategoryTab(item: any) {
  const handleBtnClick = () => {};
  return;
  <ButtonGroup>
    <Button>{item.item.categoryName}</Button>
  </ButtonGroup>;
}

const Button = styled.li`
  margin-left: 2px;
  overflow: hidden;
  background: #ffffff;
  padding: 12px 16px;
  border: 1px solid #e8e8e8;
  border-radius: 20px;
  font-weight: 500;
  font-size: 14px;
  line-height: 14px;
  height: 38px;
  float: left;
  cursor: pointer;
`;
